import React, { Component } from 'react';

class ListFlight extends Component {
    render() {
        return (
            <div>
                <p>{ this.props.departureIataCode }</p>
                <p>{ this.props.arrivalIataCode }</p>
                <p>{ this.props.airline }</p>
                <p>Harga: {this.props.airline == 'Batik Air' && 
                    <span>{ this.props.estimasi_harga_batik }</span>
                } </p>
                <p>Harga: {this.props.airline == 'Citilink' && 
                    <span>{ this.props.estimasi_harga_citilink }</span>
                } </p> 
                <p>Harga: {this.props.airline == 'Garuda Indonesia' && 
                    <span>{ this.props.estimasi_harga_garuda }</span>
                } </p> 
                <p>Harga: {this.props.airline == 'Lion Air' && 
                    <span>{ this.props.estimasi_harga_lion }</span>
                } </p> 
                <p>Harga: {this.props.airline == 'Sriwijaya Air' ? (
                    <span>{ this.props.estimasi_harga_sriwijaya }</span>
                    ) : (
                    <span>{ this.props.estimasi_harga_lain }</span>
                )}</p>
                <div className="text-right">
                    <a href="#">Baca selengkapnya...</a>
                </div>
                <hr/>
            </div>
        )
    }
}

export default ListFlight;
